import React, { useState, useEffect } from "react";

export default function TerminalMap() {
  // Mock map data
  const [mapData, setMapData] = useState([
    { id: 1, gate: "A1", x: 50, y: 100 },
    { id: 2, gate: "A2", x: 150, y: 120 },
    { id: 3, gate: "B1", x: 300, y: 200 },
  ]);

  const [selectedGate, setSelectedGate] = useState(null);

  const handleGateClick = gate => setSelectedGate(gate);

  return (
    <div style={{ padding: "2rem" }}>
      <h1>Terminal Map</h1>
      <div
        style={{
          width: "600px",
          height: "400px",
          border: "2px solid #ccc",
          position: "relative",
          background: "#f0f0f0",
          marginTop: "1rem",
        }}
      >
        {mapData.map(gate => (
          <div
            key={gate.id}
            onClick={() => handleGateClick(gate)}
            style={{
              position: "absolute",
              left: gate.x,
              top: gate.y,
              width: "40px",
              height: "40px",
              borderRadius: "50%",
              background: "orange",
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
              cursor: "pointer",
            }}
          >
            {gate.gate}
          </div>
        ))}
      </div>
      {selectedGate && (
        <div style={{ marginTop: "1rem" }}>
          Selected Gate: {selectedGate.gate}
        </div>
      )}
    </div>
  );
}
